import React from 'react';
import './like.css'
import up from '../../../../upVote.png'
import down from '../../../../downVote.png'

function Like() {
    return (
      <div className={'like' }>
          <img src={up} alt={'up vote'} className={'vote'}></img>
            4
          <img src={down} alt={'down vote'} className={'vote'}></img>
      </div>
    );
  }

  export default Like;
